import React from 'react'
import {Link} from 'react-router-dom'

function CreatrPost() {
  return (
    <div>
        <Link to="/createpost"> Crea un post </Link>
        <Link to="/home"> Home </Link>
    </div>
  )
}

export default CreatrPost
